import React from'react'; 

const Activ =()=>{
    const[activity, setActivity] =React.useState([]);

    React.useEffect(() => {
        const actType="recreational";
        fetch(
            `http://www.boredapi.com/api/activity?type=${actType}`
            )
        .then((res)=>res.json())
        .then((json)=>{
            setActivity(json.resulets); 
        })

    },[]);

    return (
        <div className="activity">
            {activity?.map((item)=>(
                <div key={item.id}>
                    <p>{item.actType}</p>
                </div>

            ))

            }

        </div>
    );


};
export default Activ;
